import logo from './logo.svg';
import './App.css';
import Layout from './layout/layout';
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (

   <BrouserRout>
   <Routs>
    <Rout path='/' element={<Layout/>}>

    </Rout>
   </Routs>

   </BrouserRout>
  );
}

export default App;
